self.addEventListener('install', event => {
  event.waitUntil(
    caches.open('offline-cache').then(cache => cache.add('offline.html'))
  );
});

self.addEventListener('fetch', event => {
  const url = new URL(event.request.url);

  if (url.pathname.startsWith('/api/')) {
    event.respondWith(
      caches.open('api-cache').then(cache =>
        cache.match(event.request).then(cachedResponse => {
          const networkFetch = fetch(event.request)
            .then(networkResponse => {
              cache.put(event.request, networkResponse.clone());
              return networkResponse;
            })
            .catch(() => cachedResponse);
          return cachedResponse || networkFetch;
        })
      )
    );
    return;
  }

  event.respondWith(
    fetch(event.request).catch(() => caches.match('offline.html'))
  );
});
self.addEventListener('push', event => {
  const handlePush = async () => {
    if (!event.data) {
      return;
    }

    let title = 'Notificación';
    const options = {};

    try {
      const payload = event.data.json();
      if (typeof payload === 'string') {
        title = payload;
      } else if (payload && typeof payload === 'object') {
        if (payload.title) {
          title = payload.title;
        }
        if (payload.body) {
          options.body = payload.body;
        }
        if (payload.icon) {
          options.icon = payload.icon;
        }
        if (payload.badge) {
          options.badge = payload.badge;
        }
        if (payload.data) {
          options.data = payload.data;
        }
      }
    } catch (error) {
      const text = event.data.text();
      if (text) {
        options.body = text;
        if (title === 'Notificación') {
          title = text;
        }
      }
    }

    if (!options.body && title && title !== 'Notificación') {
      options.body = title;
    }

    return self.registration.showNotification(title, options);
  };

  event.waitUntil(handlePush());
});

self.addEventListener('notificationclick', event => {
  const targetUrl = '/homevisa.html';

  event.notification.close();

  event.waitUntil((async () => {
    const windowClients = await clients.matchAll({ type: 'window', includeUncontrolled: true });

    for (const client of windowClients) {
      const clientUrl = new URL(client.url);
      if (clientUrl.pathname.endsWith(targetUrl) && 'focus' in client) {
        return client.focus();
      }
    }

    return clients.openWindow(targetUrl);
  })());
});
